const main = document.querySelector('.main');
const primarySvgContainer = document.querySelector('.primary .svg');
const secondarySvgContainer = document.querySelector('.secondary .svg');

let logoIndex = 0;
let timer;

function changeLogo() {
  primarySvgContainer.innerHTML = logos[logoIndex];
  secondarySvgContainer.innerHTML = logos[logoIndex];
  console.log(logoIndex);
  logoIndex = (logoIndex != logos.length-1) ? logoIndex + 1 : 0;
}

function startTimer() {
  if (timer) return;
  timer = setInterval(changeLogo, 300);
}

function stopTimer() {
  if (!timer) return;
  clearInterval(timer);
  timer = null;
}

changeLogo();
startTimer();

main.addEventListener('click', () => {
  timer ? stopTimer() : startTimer();
});





